import React from 'react';
import './style/card.css'; // Assuming you have some styles for the card

const Card = ({ image, name, profession, location, onBook }) => {
    return (
        <div className='card'>
            <img src={image} alt={`Image of ${name}`} />
            <h3>{name}</h3>
            <p>{profession}</p>
            <p>{location}</p>
            <button onClick={onBook}>Book Now</button>
        </div>
    );
};

export default Card;
